create table uaa_role
(
    ID             varchar(36)             not null comment '角色id(uuid)'
        primary key,
    DOMAIN_ID      bigint                  null comment '域ID',
    NAME           varchar(32)             null comment '角色名称',
    IDENTIFIER     varchar(64)             null comment '角色标识符',
    STATUS         tinyint(1)              null comment '状态',
    LEVEL          int         default 300 null,
    ROLE_LEVEL_ID  bigint                  null comment '角色级别id',
    UPDATE_TIME    datetime                null comment '更新时间',
    CREATE_TIME    datetime                null comment '创建时间',
    PLATFORM_ID    bigint                  null comment '平台域id',
    TYPE           tinyint(1)              null comment '角色类型 0-自定义角色 1-系统角色',
    CREATE_USER_ID bigint                  null comment '创建人id',
    ROLE_DESC      varchar(255)            null comment '角色描述',
    empower        varchar(64) default ''  null comment '岗位授权，多选用;分隔',
    constraint UNI_DOMAIN_IDENTIFIER_PLATFORM_ID
        unique (DOMAIN_ID, IDENTIFIER, PLATFORM_ID)
)
    row_format = DYNAMIC;

